import React,{ useState } from "react";
import './Carrito.css';
import moment from 'moment';
import Cookies from "universal-cookie";
import IconCarrito from './media/iconocarrito.svg';
import 'moment/locale/es';
import * as UsuarioServer from '../Usuario/UsuarioServer';

const Carrito = () => {
    const fechaActual = moment().format('LL'); 
    const cookies = new Cookies();

    const [usuario] = useState({ id: cookies.get("id"), carrito: cookies.get("carrito"), nombre: cookies.get("nombre"), correo: cookies.get("correo"), contrasenia: cookies.get("contrasenia"), domicilio: cookies.get("domicilio") });

    return (
    
      <div className="bodyCart">
  <div id="w">
    <header id="title">
      <h1 className="h1Cart">HTML5/CSS3 Shopping Cart UI</h1>
    </header>
    <div id="page">
      <table id="cart">
        <thead>
          <tr>
            <th className="first"></th>
            <th className="third">Nombre del Videojuego</th>
            <th className="fourth">Precio</th>
            <th className="fifth">&nbsp;</th>
          </tr>
        </thead>
        <tbody>
          {/* <!-- shopping cart contents --> */}
          <tr className="productitm">
            {/* <!-- http://www.inkydeals.com/deal/ginormous-bundle/ --> */}
            <td><img src="https://i.imgur.com/8goC6r6.png" className="thumb"/></td>
            <td>Design Bundle Package</td>
            <td>$79.00</td>
            <td><span className="remove"><img src="https://i.imgur.com/h1ldGRr.png" alt="X"/></span></td>
          </tr>
         
          
          {/* <!-- tax + subtotal --> */}
          <tr className="extracosts">
            <td className="light">Shipping &amp; Tax</td>
            <td colspan="2" className="light"></td>
            <td>$35.00</td>
            <td>&nbsp;</td>
          </tr>
          <tr className="totalprice">
            <td className="light">Total:</td>
            {/* <td colspan="2">&nbsp;</td> */}
            <td colspan="2"><span className="thick">$225.45</span></td>
          </tr>
          
          {/* <!-- checkout btn --> */}
          <tr className="checkoutrow">
            <td colspan="5" className="checkout"><button id="submitbtn">Checkout Now!</button></td>
          </tr>
        </tbody>
      </table>
    </div>
  </div>
</div>

    );
};

export default Carrito;
